2:"Triple monitor setup explanation!🔥

Monitor 1: The first monitor is an 32in 1080p acer. I use this on for my main trading display. I have a larger chart on the left that is paired with time frames on monitor 2. The two other smaller charts have their own personal watchlist and are used to look for any big gainers. 

Monitor 2: The second is a 24in full HD hp monitor that serves a different purpose. This displays 4 different time frames of the same stock. It shows the time frames 4 hours, 1 hour, 15 minute, and 1 minute. This allows me to see how strong the trend is based on whether or not it is confirmed in each timeframe. 

 Laptop 1: This is a touchscreen dell laptop that’s sole purpose is to display my 30+ stock watchlist. I constantly scan this list for hot stocks. When I find a stock I’m interested in, by clicking on the watchlist it changes the 4 time frames on monitor 2 and the large chart on monitor 1 to all be the same stock.
